// src/components/SelectExistingProject.js
import React from 'react';
import { useLocation } from 'react-router-dom';

const SelectExistingProject = () => {
    const location = useLocation();
    const { language } = location.state || {}; // Access the passed language from state

    return (
        <div>
            <h2>Select Existing Project</h2>
            {language ? (
                <p>Selected Language: {language}</p> // Display the selected language
            ) : (
                <p>No language selected.</p>
            )}
            {/* Add your project selection logic here */}
        </div>
    );
};

export default SelectExistingProject;
